import React from "react";
import { SafeAreaView, TextInput } from "react-native";

function Signup(props) {
  return (
    <SafeAreaView>
      <TextInput style={styles.input} placeholder="Correo" />
    </SafeAreaView>
  );
}
const styles = StyleSheet.create({
  input: {
    margin: 3,
  },
});

export default Signup;
